INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (66,
N'Retorna os registros de metadados de todas as séries disponíveis para consulta.',
N'http://www.ipeadata.gov.br/api/',
N'{
  "@odata.context": "http://ipeadata.gov.br/api/odata4/$metadata#Metadados",
  "value": [
    {
      "SERCODIGO": "ABATE_ABPEAV",
      "SERNOME": "Abate - aves - peso das carcaças",
      "SERCOMENTARIO": "O abate de animais é mensurado por sua quantidade ou peso total das carcaças, tendo como unidade de coleta todos os estabelecimentos que efetuam a atividade de abate de animais estando sob inspeção federal, estadual ou municipal, ou seja, não está sendo considerado o abate clandestino. Neste caso, trata-se das aves, sendo facultativo a retirada de pescoços, rins, pés e cabeças. Como carcaça, entende-se que é o animal abatido, formado por massas musculares e ossos. Nota: Para 1975 - 1996: Pesquisa Mensal de Abate de Animais, IBGE. Até 1996 as informações sobre o número de cabeças abatidas e o peso total das carcaças dos rebanhos têm como unidade de coleta os estabelecimentos cuja atividade principal ou secundária era o abate de animais. A partir de 1997 a pesquisa passou a ser trimestral, tendo como unidade de coleta todos os estabelecimentos que efetuam a atividade de abate de animais e estão sob inspeção federal, estadual ou municipal, ou seja, não está sendo considerado o abate clandestino. Para 1958-1974: Estatísticas históricas do Brasil: séries econômicas, demográficas e sociais de 1550 a 1988. Mais Informações: CNAE 2.0 - Notas Explicativas, https://sidra.ibge.gov.br/tabela/1092, https://metadados.ibge.gov.br/consulta/estatisticos/operacoes-estatisticas/AX",
      "SERATUALIZACAO": "2023-06-06T10:40:00.023-03:00",
      "BASNOME": "Macroeconômico",
      "FNTSIGLA": "IBGE/Coagro",
      "FNTNOME": "Instituto Brasileiro de Geografia e Estatística, Pesquisa Trimestral do Abate de Animais (IBGE/Coagro)",
      "FNTURL": "www.ibge.gov.br",
      "PERNOME": "Anual",
      "UNINOME": "Tonelada",
      "MULNOME": "mil",
      "SERSTATUS": "A",
      "TEMCODIGO": 1,
      "PAICODIGO": "BRA",
      "SERNUMERICA": true
    }
  ]
}
');

