      "resposta": "<div class=\"ExternalClassFCA6AE5983994652A1052A957C94BEE7\"><p>O Registrato é um sistema onde você pode consultar, de graça, informações sobre empréstimos em seu nome, em quais bancos você possui conta, chaves Pix cadastradas, dívidas com órgãos públicos federais, cheques sem fundos e dados de compra ou venda de moeda estrangeira feita por você. Consulte seus relatórios no sistema Registrato.&#160;&#160;<br></p></div>",
