INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (180,
N'33. Projetos corporativos ativos no Banco Central do Brasil',
N'https://olinda.bcb.gov.br/olinda/servico/Processos_Autorizacao/versao/v1/documentacao',
N'{
  "@odata.context": "https://was-p.bcnet.bcb.gov.br/olinda/servico/SGPro2_DadosAbertosProjetos/versao/v1/odata$metadata#ObterDadosAbertosProjetos",
  "value": [
    {
      "idProjeto": 5120,
      "tituloProjeto": "Sistema Integrado de Segurança",
      "objetivoProjeto": "Modernizar o sistema de segurança em todas as edificações do Banco Central do Brasil, por meio da aquisição de novos subsistemas de CFTV e alarmes mais avançados e da evolução da plataforma analógica para o paradigma digital padronizado nesta instituição, associada à implantação de um software especializado que possibilite a integração dos subsistemas de segurança (CFTV, alarmes, controle de acessos, equipamentos de raios-X, rádios digitais e sistema de detecção de incêndio), contribuindo para a mitigação dos riscos inerentes à área de atuação da segurança.",
      "duracaoAtual": 86,
      "unidadeResponsavel": "DESEG",
      "percentualConclusao": 92
    },
    {
      "idProjeto": 5124,
      "tituloProjeto": "Transformação digital e modernização dos processos de gestão dos atos da Diretoria Colegiada",
      "objetivoProjeto": "Internalizar as melhores práticas de governança da informação, fortalecendo o processo de transformação digital em curso para atingir maior eficiência na gestão dos fluxos de trabalho da Secretaria da Diretoria e do Conselho Monetário Nacional (Sucon), dos atos decisórios da Diretoria Colegiada (DC), bem como dos colegiados Conselho Monetário Nacional (CMN), Comissão Técnica da Moeda e do Crédito (Comoc), Comitê de Estabilidade Financeira (Comef) e Comitê de Governança, Riscos e Controles (GRC).",
      "duracaoAtual": 48,
      "unidadeResponsavel": "SECRE",
      "percentualConclusao": 83
    },
    {
      "idProjeto": 5129,
      "tituloProjeto": "Aprimoramento da gestão e do controle da carteira de referência das reservas internacionais.",
      "objetivoProjeto": "O presente projeto tem por objetivo aprimorar a gestão e o controle da carteira de referência das reservas internacionais. Para este fim, irá revisar e validar os modelos atualmente utilizados para definição da carteira de referência, cálculos de risco e retorno; e desenvolver a solução corporativa para substituição do sistema departamental atualmente utilizado no Deris: Rotina Noturna.",
      "duracaoAtual": 54,
      "unidadeResponsavel": "DERIS",
      "percentualConclusao": 92
    },
    {
      "idProjeto": 5135,
      "tituloProjeto": "Gestão Dinâmica de Riscos Não Financeiros",
      "objetivoProjeto": "Aumentar a maturidade do BCB no tema gestão de riscos não financeiros, através do desenvolvimento de novos modelos de gestão de risco e do aprimoramento dos atuais modelos utilizados pelo BCB. \n\nA finalidade do projeto é permitir ao Banco Central gerir seus riscos de forma dinâmica. Ou seja, as informações de risco não financeiros serão geradas e analisadas por meio da combinação de modelos de confirmação com os atuais modelos de percepção utilizados para a gestão de riscos não financeiros do BCB.\n\nDessa forma, o projeto propiciará os seguintes benefícios:\n-\tAumento da maturidade do BCB em gestão de riscos;\n-\tDesenvolvimento e implantação de modelo de avaliação de riscos com base em incidentes.",
      "duracaoAtual": 44,
      "unidadeResponsavel": "DERIS",
      "percentualConclusao": 90
    },
    {
      "idProjeto": 5136,
      "tituloProjeto": "Regulação Prudencial \u001a Mensuração de riscos e divulgação de informações relativas aos riscos social, ambiental e climático",
      "objetivoProjeto": "Aprimorar a regulação associada a aspectos sociais, ambientais e climáticos, incluindo:\n(1) revisão das regras de gerenciamento integrado de riscos;\n(2) revisão das regras de responsabilidade social, ambiental e climática;\n(3) estabelecimento de regra para divulgação de informações pelas instituições; e\n(4) estabelecimento, quando aplicável, de metodologias ou indicadores para a mensuração dos riscos\nsocial, ambiental e climático, considerando as especificidades do mercado brasileiro.",
      "duracaoAtual": 30,
      "unidadeResponsavel": "DEREG",
      "percentualConclusao": 50
    }
  ]
}');

