      "dataReferencia": "2023-09-28",
      "issn": "ISSN 1517-6576",
      "edicao": "3",
      "volume": "25",
      "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são apresentadas em cenários com condicionantes para algumas variáveis econômicas. O Copom utiliza um conjunto amplo de modelos e cenários para orientar suas decisões de política monetária. Ao expor alguns desses cenários, o Copom procura dar maior transparência às decisões de política monetária, contribuindo para sua eficácia no controle da inflação, que é seu objetivo precípuo."
