INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (241,
N'A resposta da requisição das condições atuais das capitais traz como resposta os dados das estações meteorológicas de superfície de aeroportos das capitais dos estados brasileiros. Esses dados são os mesmos da Situação nas Estações Meteorológicas, diferenciando desse na organização e disposição, exibindo as estações dos aeroportos das capitais das UF do Brasil.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (242,
N'A resposta da requisição da Previsão de tempo para 4 dias tem como retorno as informações acerca da previsão de tempo para os próximos 4 dias (pode variar de acordo com o horário do dia, podendo apresentar a previsão para o dia atual e os próximos 3 dias) para a localidade escolhida. Os elementos do 1º. nível do arquivo XML apresentam informações sobre o município ou localidade selecionado(a) e o horário de atualização dos dados da previsão. O conjunto de elementos ''previsao'' dispõe os dados da previsão de tempo para cada dia, dispondo a condição de tempo, as temperaturas máxima e miníma e o IUV',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (243,
N'A resposta da requisição da Previsão de tempo para 7 dias tem como retorno as informações acerca da previsão de tempo para os próximos 7 dias (pode variar de acordo com o horário do dia, podendo apresentar a previsão para o dia atual e os próximos 6 dias) para a localidade escolhida. Os elementos do 1º nível do arquivo XML apresentam informações sobre o município ou localidade selecionado(a) e o horário de atualização dos dados da previsão. O conjunto de elementos ''previsao'' dispõe os dados da previsão de tempo para cada dia, dispondo a condição de tempo, as temperaturas máxima e miníma e o IUV.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (244,
N' resposta da requisição da Previsão de tempo estendida tem como retorno as informações acerca da previsão de tempo para os 7 dias após os próximos 7 dias (pode variar de acordo com o horário do dia, podendo apresentar a previsão para os próximos 6 dias) para a localidade escolhida. Os elementos do 1º nível do arquivo XML apresentam informações sobre o município ou localidade selecionado(a) e o horário de atualização dos dados da previsão. O conjunto de elementos ''previsao'' dispõe os dados da previsão de tempo para cada dia, dispondo a condição de tempo, as temperaturas máxima e miníma e o IUV.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (245,
N'A resposta da requisição das condições atuais do IUV traz como resposta os dados da incidência da radiação ultravioleta para o município ou localidade selecionado(a). Esses dados são atualizados de 15 em 15 minutos, podendo assim transmitir a real situação da radiação UV na localidade. O arquivo XML de retorno exibe dentro do elemento principal <uv></uv> informações como o nome da localidade, a UF, a data, o horário da última atualização e o índice UV no momento.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (246,
N'A resposta da requisição da Previsão de Ondas para localidades litorâneas (dia atual, manhã, tarde e noite) tem como retorno as informações acerca da previsão de ondas para o dia atual da localidade litorânea escolhida. Os elementos do 1º nível do arquivo XML apresentam informações sobre o município ou localidade litorânea(o) selecionado(a) e a data de atualização dos dados da previsão oceânica. O conjunto de elementos ''manhã'', ''tarde'' e ''noite'' mostra os dados da previsão de ondas para cada um desses períodos do dia, exibindo a data da previsão de ondas juntamente com o horário UTC (Zulu) da mesma, a agitação do mar, a altura das ondas em metros, a direção das ondas, a velocidade do vento (em km/h) e a direção do vento.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (247,
N'A resposta da requisição da Previsão de Ondas para localidades litorâneas (6 dias, 8 horários por dia) tem como retorno as informações acerca da previsão oceânica (ondas) para o dia atual e para os próximos 5 dias para a localidade litorânea escolhida. Os elementos do 1º nível do arquivo XML apresentam informações sobre o município ou localidade litorânea(o) selecionado(a) e a data de atualização dos dados da previsão oceânica. O conjunto de elementos ''previsão'' mostra os dados da previsão de ondas para cada um desses horários do dia, exibindo a data da previsão de ondas juntamente com o horário UTC (Zulu) da mesma, a agitação do mar, a altura das ondas em metros, a direção das ondas, a velocidade do vento (em km/h) e a direção do vento.',
N'http://servicos.cptec.inpe.br/XML/',
N'');

