  "objetivos": "Objetivo Geral - O projeto tem como objetivo principal promover o desenvolvimento local integrado de comunidades com baixos indices de desenvolvimento humano carentes de ações sociais, culturais economicas, dar formação completa em empreendorismo artistico. Objetivo Especifico: A formação será realizada a partir de aulas expositivas, praticas e palestras com especialistas/referências em empreendorismo artistico, produção audivisual e marketing digital. Formação de agentes multiplicadores de informação.",
  "ficha_tecnica": "O DIRIGENTE DA INSTITUIÇÃO: É o responsavel pela gestão do projeto.Vai atuar na contratação de equipes de apoio, na definição dos orçamentos, no cronograma de trabalho e captação de recursos. O trabalho é voluntario não remunerado.COORDENAÇÃO GERAL: PAULA SANTANA - Iyalorixá idealizadora e presidente do Instituto Ose Dudú, presidente do Afoxé Omó Ifá Rio de Janeiro, vice presidente do IITAB (Instituto Irê de Tradições Afro-Brasileiras), Ativista, Palestrante, graduando em serviços social (Unopar), jornalista e colunista do Axé News e pesquisadora do Grupo Africanias da Escola de Música da UFRJ. PRODUTORA - PATRICIA HANNA - Pós graduanda em Gestão e Produção Cultural com experiencias profissionais que se articulam no campo da produção de eventos socioculturais, especialmente na area de literatura, e do marketing digital. COORDENAÇÃO DE PROJETOS: RAPHA LIMA COSTA - Pesquisador de Cultura e sociedade. Especialista em monitoramento de redes sociais (social listening) e netnografia. Analista de dados sênior. Curador de conhecimento. COORDENADOR DO PROJETO: RAPHAEL SILVA BARBOSA DE FARIA: Profissional de Midia, produtor com experiencia em marketing, publicidade, promoções e produção cultural, aplicativos office e sofwares e de gerencia de projetos.",
  "situacao": "Projeto em avaliação documental",
  "outras_fontes": 0,
  "acessibilidade": "Acessibilidade Física: Na quadra da Unidos do Viradouro onde será realizado a oficina é adaptada as necessidades de portadores com deficiencia fisica e necessidades especiais é dotada de rampas, banheiro acessivel para facilitar o acesso de todos. Acessibilidade de Conteudo: Durante a realização da oficina haverá um interprete de libras para pessoas que desconhecem às linguagens de conteudos.",
  "sinopse": "Não se aplica ao projeto.",
  "nome": "VIRANDO OURO NAS REDES",
  "cgccpf": "20884026000157",
  "mecanismo": "Mecenato",
