    "incentivadores": "http://api.salic.cultura.gov.br/v1/incentivadores/?PRONAC=233666",
    "proponente": "http://api.salic.cultura.gov.br/v1/proponentes/523f817e26f95bf57701b4f1e7c775d1ac373f20065f2c128908cabf5b33"
  },
  "segmento": "Ações de formação capacitação treinamento pessoal",
  "PRONAC": "233666",
  "estrategia_execucao": "Todas as informações foram abordadas nos campos anteriores.",
  "valor_aprovado": 0,
  "justificativa": "Durante a pandemia da COVID 19, foi observado entre os anos de 2020 e 2021 a mudança da forma com que os diferentes mercados se relacionam com seu público, dentre elas, podemos destacar o mercado das artes, que segundo pesquisas, durante a pandemis teve um crescimento de 46% em relação ao ano de 2019. Alguns especialistas apontam que esse crescimento se deve à crescente onda de vendas de obras artisticas pela internet. Também foi na pandemia que observamos artistas emergentes a crescer, impulsionados, pelas redes sociais. Pensando nesse panorama e no crescente mercado de venda de obras artisticas na internet e como podemos contribuir para artistas que não residem nos grandes centros urbanos. O mecanismo de Incentivo a Projetos Culturais na proposta 393.704 é importante na formação completa em empreendedorismo artístico e cultural.",
  "resumo": "Formar e capacitar jovens e adultos tendo como foco quatro eixos tematicos comunicação, empreenddorismo, audiovisual e artistico a oficina será ministrada em oito meses com duas turmas com cerca de 40 alunos totalizando 80 jovens e adultos.",
