  "democratizacao": "Democratização de acesso: Todas as vagas das oficinas serão gratuitas com carater social para comunidade. Ampliação de acesso: Art. 28 da IN nº01/2023 I-Doar 10% (dez por cento) dos produtos resultantes da execução do projeto para distribuição gratuita com carater social. IV-Disponibilizar, na internet, registros audiovisuais dos espetaculos, das exposições das atividades de ensino e de outros eventos referente a produção principal. VI-Realizar, gratuitamente, atividades paralelas aos projetos, tais como ensaios abertos, estagios, cursos, treinamentos, palestras, exposições, mostras e oficinas; X-Rodas de conversas",
