        "ficha_tecnica": "FICHA TECNICA:\u00A0 Funda\u00E7\u00E3o Cultural - PROPONENTE - Coordena\u00E7\u00E3o Geral de Produ\u00E7\u00E3o e Idealiza\u00E7\u00E3oINTEGRAM A EQUIPE DE COORDENA\u00C7\u00C3O E ORGANIZA\u00C7\u00C3O GERAL DO EVENTO - Profissionais da Funda\u00E7\u00E3o Cultural propone",
