        "outras_fontes": 0,
        "acessibilidade": "PRODUTO 1 - Feira Liter\u00E1ria ACESSIBILIDADE NO ASPECTO ARQUITET\u00D4NICO: rampas\u00A0e banheiros adaptados ACESSIBILIDADE PARA DEFICIENTES VISUAIS: Audiodescri\u00E7\u00E3o nas rodas de conversa com os autores ACESSI",
        "sinopse": "Realiza\u00E7\u00E3o do evento anual, organizado pela Prefeitura Municipal em parceria com o setor do com\u00E9rcio do livro e outras institui\u00E7\u00F5es p\u00FAblicas e privadas de interesse como: governo estadual, universidades, ag\u00EAncias de desenvolvimento, entre outras.\u00A0 O formato do evento permite a comercializa\u00E7\u00E3o de livros e outros itens, somado \u00E0s atra\u00E7\u00F5es de car\u00E1ter cultural e educacional. Tamb\u00E9m \u00E9 ambiente de converg\u00EAncia de a\u00E7\u00F5es diversas de car\u00E1ter p\u00FAblico ou privado que contribuem para a realiza\u00E7\u00E3o dos objetivos descritos.\u00A0 Por se tratar de uma a\u00E7\u00E3o que envolve m\u00FAltiplas secretarias da prefeitura e outras institui\u00E7\u00F5es, anualmente, a Prefeitura instituiu uma comiss\u00E3o organizadora respons\u00E1vel pelo evento, sendo a Funda\u00E7\u00E3o Cultural incumbida de liderar a tarefa.",
