        "estrategia_execucao": "O proponente n\u00E3o receber\u00E1 por nenhum cargo a ser executado por ele, tendo a execu\u00E7\u00E3o de alguns servi\u00E7os prestados a partir de quadro profissional da pr\u00F3pria Funda\u00E7\u00E3o Cultural.",
