INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (417,
N'Dados detalhados de uma proposta',
N'',
N'{
  "data_arquivamento": null,
  "acessibilidade": "Com o objetivo de permitir o\u00A0ingresso de pessoas portadoras de defici\u00EAncia f\u00EDsica, os locais de lan\u00E7amento, tanto na capital ga\u00FAcha com nas cidades do interior, ter\u00E3o o accesso facilitado atrav\u00E9s de rampas entre outras facilidades. As legendas das fotos da exposi\u00E7\u00E3o tamb\u00E9m ser\u00E3o em braile, permitindo que pessoas com defici\u00EAncia visual tenham condi\u00E7\u00F5es de conhecer um pouco sobre o material exposto. Os profissionais que ir\u00E3o trabalhar tamb\u00E9m estar\u00E3o\u00A0treinados a orientar pessoas com outros tipos de defici\u00EAncia.",
  "impacto_ambiental": "",
  "nome": "Retratos Ga\u00FAchos: Seus Povos, Sua Almas",
  "democratizacao": "Com o objetivo de democratizar o acesso de camadas menos favorecidas ao material elaborado pelo projeto, teremos: - Acesso gratuito a exposi\u00E7\u00E3o de fotos constantes no livro; - Distribui\u00E7\u00E3o gratuita de exemplares aos visitantes do lan\u00E7amento do livro (respeitando o limite disponibilizado para cada localidade).",
  "justificativa": "\u00C9 not\u00F3rio que a hist\u00F3ria de uma cidade, estado ou pa\u00EDs deve-se muito aos povos que escolheram aquele lugar como sua moradia, seu habitat para criar sua fam\u00EDlia.\u00A0Num mesmo local podemos ter diferentes culturas convivendo e constru\u00EDndo a hist\u00F3ria. A integra\u00E7\u00E3o destes povos faz surgir uma cultura miscigenada, onde as pessoas procuram conviver de modo harm\u00F4nico, ora com seus h\u00E1bitos e costumes, ora integrando-se\u00A0com os costumes de outros povos. Propiciar aos leitores o contato\u00A0com estas\u00A0culturas diversificadas, as diferente maneiras de viver de\u00A0povos que construiram um local \u00E9 uma forma de divulgar e preservar a hist\u00F3ria. Hist\u00F3ria essa que gira em torno dos seus h\u00E1bitos, seus costumes, suas tradi\u00E7\u00F5es, sua vontade de construir, de crescer, de trabalhar e de se desenvolver. \u00A0 Quando foi lan\u00E7ado o livro \u201CRio Grande do Sul: Seu Povo, Sua Alma\u201D apoiado pela Lei Rouanet (Pronac 076716) muitos leitores questionaram porque outras etnias n\u00E3o constavam nesta publica\u00E7\u00E3o. \u00C1rabes, poloneses entre outros, ao parabenizarem pela obra, fizeram esta pergunta, pois se consideram tamb\u00E9m importantes na constru\u00E7\u00E3o do estado do Rio Grande do Sul. Buscando qualificar a obra produzida anteriormente,\u00A0o projeto \u201CRetratos Ga\u00FAchos: Seus Povos, Sua Alma\u201D quer reunir em uma \u00FAnica publica\u00E7\u00E3o a\u00A0hist\u00F3ria de dezessete povos atrav\u00E9s de fotos e textos: como chegaram, onde se estabeleceram, sua cultura, como criaram suas comunidades, quais suas atividades econ\u00F4micas, como cresceram e fizeram o estado crescer. O livro ir\u00E1 abordar as seguintes etnias:\u00A0alem\u00E3es, italianos, japoneses, judeus, \u00EDndios, espanh\u00F3is, a\u00E7orianos, negros, \u00E1rabes, palestinos, chineses, coreanos, poloneses, russos, suecos, austr\u00EDacos e ucranianos. Nesta mesma linha, para democratizar o acesso a cultura e a obra produzida, o lan\u00E7amento do livro ser\u00E1 realizado na capital ga\u00FAcha e em quatro cidades do interior do estado, sempre com entrada franca ao p\u00FAblico e distribui\u00E7\u00E3o gratuita dos exemplares. \u00A0 O livro ser\u00E1 um resgate fotogr\u00E1fico destes povos: suas express\u00F5es, sua for\u00E7a trabalhadora, seus rostos suados e a obstina\u00E7\u00E3o com o crescimento, a alegria de uma festa, de um nascimento, de uma colheita bem sucedida, de uma grande obra realizada, da fam\u00EDlia reunida. Enfim, vamos mostrar a alma do povo ga\u00FAcho, daqueles que colonizaram, ajudaram e ajudam o estado a crescer. \u00A0 Para o seu lan\u00E7amento, realizaremos uma exposi\u00E7\u00E3o fotogr\u00E1fica com o material utilizado na sua produ\u00E7\u00E3o. O lan\u00E7amento acontecer\u00E1 na capital ga\u00FAcha \u2013 Porto Alegre. Depois, segue para quatro cidades do interior do estado: Caxias do Sul, Lajeado, Santa Rosa e Passo Fundo. \u00A0 Com o apoio da Lei Rouanet, al\u00E9m da viabiliza\u00E7\u00E3o do projeto, toda a tiragem do livro ser\u00E1 distribu\u00EDda gratuitamente, tanto nos lan\u00E7amentos, quanto para bibliotecas, escolas e secretarias municipais. Com isto, pretende-se democratizar o acesso a cultura, propiciando a um n\u00FAmero maior de leitores o contato com a cultura riograndense. \u00A0 Quanto ao\u00A0conte\u00FAdo editorial e fotogr\u00E1fico do livro, uma parte ser\u00E1 composta pelo material utilizado no livro \u201CRio Grande do Sul: Seu Povo, Sua Alma\u201D, a que refere-se as seguintes etnias: alem\u00E3es, italianos, japoneses, judeus, \u00EDndios, espanh\u00F3is, a\u00E7orianos e negros. Uma nova pesquisa de conte\u00FAdo e fotogr\u00E1fica ser\u00E1 realizada para completar o livro, que ir\u00E1 compreender outras nove etnias, sendo elas: \u00E1rabes, palestinos, chineses, coreanos, poloneses, russos, suecos, austr\u00EDacos e ucranianos. Assim, os custos dos profissionais respons\u00E1veis pela parte editorial e fotogr\u00E1fica, lan\u00E7ados na planilha de custos, referem-se somente a esta nova pesquisa.",
  "mecanismo": "Mecenato",
  "resumo": "Publica\u00E7\u00E3o de um livro que relate a hist\u00F3ria de dezessete povos que ajudaram a colonizar o estado do Rio Grande do Sul (alem\u00E3es, italianos, japoneses, judeus, \u00EDndios, espanh\u00F3is, a\u00E7orianos, negros, \u00E1rabes, palestinos, chineses, coreanos, poloneses, russos, suecos, austr\u00EDacos e ucranianos). Quais suas contribui\u00E7\u00F5es para a cultura e o desenvolvimento do estado. Lan\u00E7amento do livro na capital ga\u00FAcha e em quatro cidades do interior. Tiragem de tr\u00EAs mil exemplares, com distribui\u00E7\u00E3o gratuita.",
  "sinopse": "",
  "especificacao_tecnica": "",
  "data_inicio": "2009-04-10",
  "objetivos": "GERAL: - Editar e publicar um livro que mostre a hist\u00F3ria de dezessete povos que \u00A0ajudaram a colonizar o estado do Rio Grande do Sul: sua contribui\u00E7\u00E3o para o crescimento, como eles viveram e vivem atualmente e quais suas atividades. Lan\u00E7amento do livro na capital ga\u00FAcha e em quatro cidades do interior. \u00A0 ESPEC\u00CDFICOS: - Divulgar a hist\u00F3ria do Rio Grande do Sul no que tange aos povos que colonizaram; - Estimular os leitores a conhecerem mais sobre a hist\u00F3ria da coloniza\u00E7\u00E3o do nosso estado; - Servir como material de preserva\u00E7\u00E3o da hist\u00F3ria dos povos que construiram o Rio Grande do Sul; - Com a distribui\u00E7\u00E3o gratuita, quer-se atingir um elevado n\u00FAmero de estudantes e leitores menos favorecidos; - Propiciar a comunidades do interior do estado, das cidades de Caxias do Sul, Lajeado, Santa Rosa e Passo Fundo o contato com material que divulgue a cultura riograndense;",
  "ficha_tecnica": "",
  "etapa": "A edi\u00E7\u00E3o do livro \u201CRetratos Ga\u00FAchos: Seus Povos, Sua Alma\u201D prev\u00EA as seguintes a\u00E7\u00F5es: ABRIL Capta\u00E7\u00E3o dos recursos com apoio da Lei Rouanet; ABRIL, MAIO E JUNHO Organiza\u00E7\u00E3o da equipe de editor, pesquisador, fot\u00F3grafo, diagramador e revisor; Defini\u00E7\u00E3o do projeto editorial do livro; Defini\u00E7\u00E3o do projeto gr\u00E1fico do livro; Planejamento das fotos a serem executadas; Planejamento de entrevistas e depoimentos; Pesquisa junto \u00E0 entidades culturais do estado, bibliotecas, associa\u00E7\u00F5es e outros locais, dos materiais necess\u00E1rios para edi\u00E7\u00E3o do livro; Organiza\u00E7\u00E3o do material selecionado; JULHO E AGOSTO Produ\u00E7\u00E3o dos textos; Digitaliza\u00E7\u00E3o e tratamento das fotos selecionadas; Diagrama\u00E7\u00E3o do material selecionado; Revis\u00E3o e corre\u00E7\u00E3o dos textos; Finaliza\u00E7\u00E3o do trabalho de produ\u00E7\u00E3o do livro; Envio do material para gr\u00E1fica para impress\u00E3o; SETEMBRO Impress\u00E3o do livro; Prepara\u00E7\u00E3o do material para realiza\u00E7\u00E3o da exposi\u00E7\u00E3o e lan\u00E7amento do livro na capital ga\u00FAcha; OUTUBRO Divulga\u00E7\u00E3o atrav\u00E9s da m\u00EDdia; Distribui\u00E7\u00E3o de convites; Realiza\u00E7\u00E3o do lan\u00E7amento do livro e exposi\u00E7\u00E3o na capital ga\u00FAcha; NOVEMBRO E DEZEMBRO Planejamento do lan\u00E7amento nas quatro cidades do interior; Divulga\u00E7\u00E3o atrav\u00E9s da m\u00EDdia; Distribui\u00E7\u00E3o dos convites; Lan\u00E7amento nas cidades do interior; ABRIL A DEZEMBRO Pagamento de impostos. DEZEMBRO Envio dos livros para as bibliotecas, conforme Minc; Presta\u00E7\u00E3o de contas.",
  "data_aceite": null,
  "id": 1,
  "estrategia_execucao": "",
  "data_termino": "2009-12-31"
}');

