INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (431,
N'Retorna uma lista de informações sobre os pronunciamentos feitos pelo deputado identificado por {id} que tenham sido registrados, em quaisquer eventos, nos sistemas da Câmara.',
N'',
N'{
    "dados": [
        {
            "dataHoraInicio": "2024-04-16T18:56",
            "dataHoraFim": null,
            "uriEvento": "",
            "faseEvento": {
                "titulo": "Ordem do Dia",
                "dataHoraInicio": null,
                "dataHoraFim": null
            },
            "tipoDiscurso": "PELA ORDEM",
            "urlTexto": "https://imagem.camara.gov.br/dc_20b.asp?largura=&altura=&tipoForm=diarios&selCodColecaoCsv=D&Datain=17%2F4%2F2024&txPagina=&txSuplemento=&enviar=Pesquisar",
            "urlAudio": null,
            "urlVideo": null,
            "keywords": null,
            "sumario": null,
            "transcricao": "A SRA. ERIKA HILTON (Bloco/PSOL - SP. Pela ordem. Sem revisão da oradora.) - Presidente, a Federação PSOL REDE orienta o voto \"não\", porque esse projeto que está colocado é uma grave violação aos direitos humanos. Não existe invasão de terra. Existe ocupação legítima, reconhecida pelo Judiciário. E esta Casa mais uma vez se coloca na contramão da defesa dos mais vulneráveis, dos mais precarizados. Nós tivemos aqui uma CPI extremamente necessária, que não deu em nada. É importante respeitar os direitos humanos. É importante respeitar os movimentos em defesa da ocupação das terras. Estes projetos são projetos criminosos, que, além de criminalizar os movimentos sociais, ainda atacam bravamente os direitos humanos e estes grupos que já são violentados. Por isso, a orientação da Federação PSOL REDE é pelo \"não\" ao requerimento de urgência."
        },
        {
            "dataHoraInicio": "2024-04-16T19:36",
            "dataHoraFim": null,
            "uriEvento": "",
            "faseEvento": {
                "titulo": "Ordem do Dia",
                "dataHoraInicio": null,
                "dataHoraFim": null
            },
            "tipoDiscurso": "COMO LÍDER",
            "urlTexto": "https://imagem.camara.gov.br/dc_20b.asp?largura=&altura=&tipoForm=diarios&selCodColecaoCsv=D&Datain=17%2F4%2F2024&txPagina=&txSuplemento=&enviar=Pesquisar",
            "urlAudio": null,
            "urlVideo": null,
            "keywords": null,
            "sumario": null,
            "transcricao": "A SRA. ERIKA HILTON (Bloco/PSOL - SP. Como Líder. Sem revisão da oradora.) - Pode combinar o tempo, Presidente. A orientação do PSOL é o voto \"sim\" ao projeto que está colocado. Mas venho aqui me somar aos meus colegas e ao Líder do Governo, que manifestou a nossa surpresa, desagradável surpresa, ao vermos esses projetos sendo colocados, inclusive como primeiro item da pauta. Isso não foi tratado na reunião do Colégio de Líderes. Nós fomos pegos de surpresa porque tínhamos entendido que a pauta que estaria no Plenário neste momento era uma pauta tranquila, quase consensual. E, de repente, voltam os projetos de criminalização dos movimentos sociais. Há um projeto descabido, um projeto que ataca os direitos humanos, um projeto que não deveria estar como primeiro item da pauta. E não há só esse projeto. Há outros projetos na pauta de hoje que não foram tratados e não foram discutidos pelos Líderes no Colégio de Líderes. Qual é a finalidade do Colégio de Líderes e qual é a finalidade dos acordos que nós fazemos, na condição de Líderes, no Colégio de Líderes, para sermos surpreendidos, de forma negativa, com esses projetos nefastos e horrorosos que estão colocados para serem votados? Inclusive, o primeiro já foi votado. Então, é importante, Presidente, que nós olhemos para aquilo que foi colocado pelo Líder do Governo, para aquilo que foi colocado pelo Líder que acabou de sair desta tribuna, que não há a menor possibilidade, não há o menor clima para que esses projetos se mantenham na pauta e para que esses projetos sejam votados. Não há acordo entre os Líderes, e esse tema não foi tratado com a seriedade de que ele precisa, na reunião de Líderes, na residência oficial, na tarde de hoje. São projetos que mexem com a vida das pessoas, são projetos que pretendem criminalizar os movimentos sociais e não podem ser votados à revelia, da maneira como estão sendo votados. Ainda que não seja o mérito, que sejam os requerimentos de urgência, nós não tivemos acordo para que esta votação ocorresse da forma como ela está ocorrendo. É isso, Presidente."
        },
        {
            "dataHoraInicio": "2024-04-16T19:44",
            "dataHoraFim": null,
            "uriEvento": "",
            "faseEvento": {
                "titulo": "Ordem do Dia",
                "dataHoraInicio": null,
                "dataHoraFim": null
            },
            "tipoDiscurso": "PELA ORDEM",
            "urlTexto": "https://imagem.camara.gov.br/dc_20b.asp?largura=&altura=&tipoForm=diarios&selCodColecaoCsv=D&Datain=17%2F4%2F2024&txPagina=&txSuplemento=&enviar=Pesquisar",
            "urlAudio": null,
            "urlVideo": null,
            "keywords": null,
            "sumario": null,
            "transcricao": "A SRA. ERIKA HILTON (Bloco/PSOL - SP. Pela ordem. Sem revisão da oradora.) - Presidente, antes de orientar quero dizer que é um absurdo o Deputado usar a tribuna para falar sobre respeito enquanto diz que vai pedir exame toxicológico aos colegas. O respeito é mútuo. O respeito tem que ir e tem que vir. O SR. BIBO NUNES (PL - RS) - Vou! A SRA. ERIKA HILTON (Bloco/PSOL - SP) - V.Exa. pode pedir o que quiser, só não poder ser hipócrita de falar em respeito desrespeitando seus colegas. É essa a questão. Peça os exames que V.Exa. julgar necessários, mas não use de hipocrisia para falar de respeito quando vocês desconhecem o sentido da palavra respeito. Os maiores desrespeitadores são os senhores. Presidente, dito isso, que é importante, a Federação PSOL REDE orienta o voto \"sim\", pela importância de uma política de cuidado aos mais necessitados, às demências e suas naturezas, que precisam de atenção e de uma política tão importante como essa."
        }
    ],
    "links": [
        {
            "rel": "self",
            "href": "https://dadosabertos.camara.leg.br/api/v2/deputados/220645/discursos?ordenarPor=dataHoraInicio&ordem=ASC"
        },
        {
            "rel": "first",
            "href": "https://dadosabertos.camara.leg.br/api/v2/deputados/220645/discursos?ordenarPor=dataHoraInicio&ordem=ASC&pagina=1&itens=15"
        },
        {
            "rel": "last",
            "href": "https://dadosabertos.camara.leg.br/api/v2/deputados/220645/discursos?ordenarPor=dataHoraInicio&ordem=ASC&pagina=1&itens=15"
        }
    ]
}');

