INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (512,
N'Retorna um conjunto detalhado de dados sobre a votação identificada por {id}, tais como as proposições que podem ter sido o objeto da votação e os efeitos de tramitação de outras proposições que eventualmente tenham sido cadastrados em consequência desta votação.',
N'',
N'{
    "dados": {
        "id": "2372071-13",
        "uri": "https://dadosabertos.camara.leg.br/api/v2/votacoes/2372071-13",
        "data": "2023-09-05",
        "dataHoraRegistro": "2023-09-05T21:04:26",
        "siglaOrgao": "SECAP(SGM)",
        "uriOrgao": "https://dadosabertos.camara.leg.br/api/v2/orgaos/100001",
        "idOrgao": 100001,
        "uriEvento": null,
        "idEvento": null,
        "descricao": "Realizar o encaminhamento do PLP-136/2023 à CFT (tramitação simultânea), em razão da aprovação de requerimento de urgência.",
        "aprovacao": 1,
        "descUltimaAberturaVotacao": null,
        "dataHoraUltimaAberturaVotacao": null,
        "ultimaApresentacaoProposicao": {
            "dataHoraRegistro": null,
            "descricao": null,
            "uriProposicaoCitada": null
        },
        "efeitosRegistrados": [],
        "objetosPossiveis": [
            {
                "id": 2372072,
                "uri": "https://dadosabertos.camara.leg.br/api/v2/proposicoes/2372072",
                "siglaTipo": "MSC",
                "codTipo": 134,
                "numero": 302,
                "ano": 2023,
                "ementa": "Submete à apreciação do Congresso Nacional o texto do Projeto de Lei Complementar que \"Dispõe sobre a compensação devida pela União, nos termos do disposto nos art. 3º e art. 14 da Lei Complementar nº 194, de 23 de junho de 2022; a dedução das parcelas dos contratos de dívida; a transferência direta de recursos da União aos Estados e ao Distrito Federal; a incorporação do excesso compensado judicialmente em saldo devedor de contratos de dívida administrados pela Secretaria do Tesouro Nacional do Ministério da Fazenda; e o tratamento jurídico e contábil aplicável aos pagamentos, às compensações e às vinculações\"."
            }
        ],
        "proposicoesAfetadas": [
            {
                "id": 2372071,
                "uri": "https://dadosabertos.camara.leg.br/api/v2/proposicoes/2372071",
                "siglaTipo": "PLP",
                "codTipo": 140,
                "numero": 136,
                "ano": 2023,
                "ementa": "Dispõe sobre a compensação devida pela União, nos termos do disposto nos art. 3º e art. 14 da Lei Complementar nº 194, de 23 de junho de 2022; a dedução das parcelas dos contratos de dívida; a transferência direta de recursos da União aos Estados e ao Distrito Federal; a incorporação do excesso compensado judicialmente em saldo devedor de contratos de dívida administrados pela Secretaria do Tesouro Nacional do Ministério da Fazenda; e o tratamento jurídico e contábil aplicável aos pagamentos, às compensações e às vinculações.  NOVA EMENTA: Dispõe sobre a compensação devida pela União nos termos dos arts. 3º e 14 da Lei Complementar nº 194, de 23 de junho de 2022, a dedução das parcelas dos contratos de dívida, a transferência direta de recursos da União aos Estados e ao Distrito Federal, a incorporação do excesso compensado judicialmente em saldo devedor de contratos de dívida administrados pela Secretaria do Tesouro Nacional do Ministério da Fazenda, o tratamento jurídico e contábil aplicável aos pagamentos, às compensações e às vinculações, as transferências de recursos aos Municípios em razão da redução das receitas do Fundo de Participação dos Municípios (FPM), as transferências de recursos aos Estados e ao Distrito Federal em razão da redução das receitas do Fundo de Participação dos Estados e do Distrito Federal (FPE) e as regras relativas ao Imposto sobre Operações Relativas à Circulação de Mercadorias e sobre Prestações de Serviços de Transporte Interestadual e Intermunicipal e de Comunicação (ICMS); e revoga dispositivo da Lei nº 5.172, de 25 de outubro de 1966 (Código Tributário Nacional), e das Leis Complementares nºs 87, de 13 de setembro de 1996 (Lei Kandir), e 192, de 11 de março de 2022."
            }
        ]
    },
    "links": [
        {
            "rel": "self",
            "href": "https://dadosabertos.camara.leg.br/api/v2/votacoes/2372071-13"
        }
    ]
}');

