INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (620,
N'Detalha um conjunto de dados - GET',
N'',
N'{
  "id": "93b2740e-329b-4ef6-ab15-0ed59084f78d",
  "titulo": "Indicadores sobre Ensino Técnico",
  "organizacao": "ministerio-da-educacao-mec",
  "inventario": null,
  "descricao": "Série histórica de indicadores dos resultados governamentais relativos à Ensino Técnico. PGI é um repositório de informações estruturadas (indicadores) à feição dos processos de governança para o Governo Federal; ou seja, um repositório de compartilhamento de indicadores de políticas públicas.\n\n**Atenção:** os dados das séries de indicadores são fornecidos por seu valor\nhistórico e não serão mais atualizados após dezembro/2014.\n\nFonte: [Plataforma de Gestão de Indicadores (PGI)](http://pgi.gov.br/pgi/)\n\n## Sobre o PGI\n\nA Plataforma de Gestão de Indicadores (PGI) foi uma ferramenta criada em 2010,\nno âmbito do [projeto I3Gov](https://i3gov.planejamento.gov.br/), para agregar\nséries de indicadores de gestão a partir de informações prestadas por diversos\nórgãos federais.\n\nFoi desativada no início de 2015 pela Casa Civil da Presidência da República,\nentretanto, ficou estabelecido que o Ministério do Planejamento, Orçamento e\nGestão manteria disponíveis os dados históricos que haviam sido cadastrados\naté dezembro de 2014.\n\nCada grupo de série histórica foi mapeada para um conjunto de dados e cada\nsérie de indicadores foi mapeada para um recurso. Os dados são servidos nos\nformatos XML e JSON pela API do PGI.\n",
  "licenca": "odc-odbl",
  "responsavel": "Gabinete do Ministro - (MEC/GABMIN)",
  "emailResponsavel": null,
  "periodicidade": null,
  "temas": [],
  "tags": [
    {
      "id": "0ad8d345-b867-42fa-af4c-1deb080d25d0",
      "name": "Indicador",
      "display_name": null
    },
    {
      "id": "38e39aa2-e018-413f-a93b-b0c146828886",
