INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (632,
N'Lista organizações - GET',
N'',
N'[
  {
    "id": "008945aa-7ac9-4023-b04f-8d57286a7dd6",
    "urlImagem": "https://dados.gov.br/api/publico/s3/cce2f4c4-ee10-4faf-be93-a97bc6b586bd.png",
    "titulo": "instituto-federal-de-educacao-ciencia-e-tecnologia-do-amazonas-ifam",
    "descricao": "A criação dos Institutos Federais de Educação, Ciência e Tecnologia pelo Governo Federal constituiu uma ação de caráter revolucionário no País, tendo como base a Rede Federal de Educação Tecnológica. Os Institutos surgiram com uma proposta de expansão do ensino técnico e tecnológico jamais vista, uma vez que promovem o ensino nos níveis básico, técnico e tecnológico, incluindo programas de formação e qualificação de trabalhadores, licenciaturas e cursos de pós-graduação lato e stricto sensu.\r\n\r\nAtualmente, o IFAM está estabelecido em 23 municípios, sendo três deles, polos de Educação a Distância em Roraima. No primeiro semestre de 2018, a Instituição já soma 25.768 matrículas, segundo a Plataforma Nilo Peçanha, distribuídos em 162 cursos técnicos presenciais, 68 cursos em EaD, 15 tecnólogos, sete Licenciaturas, cinco Bacharelados, duas especializações Lata Sensu e três Mestrados Profissionais. Além disso, contamos com 1.967 servidores em todo o Estado.",
    "nome": "instituto-federal-de-educacao-ciencia-e-tecnologia-do-amazonas-ifam",
    "qtdConjuntoDeDados": "0",
    "qtdSeguidores": "0",
    "organizationEsfera": "",
    "organizationUf": "",
    "organizationMunicipio": ""
  },
  {
    "id": "02840def-849e-4bbd-ac98-bfebeecd303d",
    "urlImagem": "https://dados.gov.br/api/publico/s3/ed2cfd95-599a-48fc-9e22-a2408395204d.jpg",
    "titulo": "ministerio-da-infraestrutura-minfra",
    "descricao": "O [Ministério da Infraestrutura](https://www.infraestrutura.gov.br/) é o órgão da administração pública federal direta que tem como áreas de atuação a política nacional de transportes dos modais ferroviário, rodoviário e aquaviário, além de realizar ações no âmbito da marinha mercante, das vias navegáveis e dos portos fluviais e lacustres (excetuados os que estão sob a responsabilidade das companhias docas). O Ministério também possui competência para participar da coordenação dos transportes aeroviários e serviços portuários.\r\n\r\n\r\nAs ações do Ministério abrangem a formulação, coordenação e supervisão das políticas nacionais para o setor, a participação no planejamento estratégico, a elaboração de diretrizes para a sua implementação e a definição das prioridades dos programas de investimentos. Para que o órgão execute suas competências e possa desenvolver programas e projetos, as ações e programas agem como ferramentas que auxiliam o ministério e os órgãos vinculados para as tomadas de decisão que definirão as ações do sistema de transportes do país.",
    "nome": "ministerio-da-infraestrutura-minfra",
    "qtdConjuntoDeDados": "131",
    "qtdSeguidores": "0",
    "organizationEsfera": "",
    "organizationUf": "",
    "organizationMunicipio": ""
  },
  {
    "id": "028848f3-33e4-4a5f-ad0a-1802113610e3",
    "urlImagem": "https://dados.gov.br/api/publico/s3/575fa092-39b8-400d-8a10-933b6b384eac.gif",
    "titulo": "caixa-economica-federal-cef",
    "descricao": "Criada, em 1861, a [Caixa](http://www.caixa.gov.br) é, por exemplo, o agente responsável pelo Fundo de Garantia do Tempo de Serviço (FGTS), pelo Programa de Integração Social (PIS) e pelo Seguro-Desemprego. Atua em programas sociais do governo, como o Bolsa Família, FIES e Programa Minha Casa Minha Vida.\r\n\r\nA Caixa atua na promoção da cidadania e do desenvolvimento sustentável do País, como instituição financeira, agente de políticas públicas e parceira estratégica do Estado brasileiro.",
