    "urlImagem": "https://dados.gov.br/api/publico/s3/e38d204b-d56b-4b60-97f4-3e34ea9b65ee.png",
    "titulo": "Instituto Federal de Educação, Ciência e Tecnologia do Acre - IFAC",
    "descricao": "O Instituto Federal do Acre é uma autarquia federal criada pela Lei nº 11.892, de 29 de dezembro de 2008, integrante da Rede Federal de Educação Profissional, Científica e Tecnológica, vinculada ao Ministério da Educação. Os Institutos Federais são instituições de educação superior, básica e profissional, pluricurriculares e multicampi, especializados na oferta de educação profissional e tecnológica nas diferentes modalidades de ensino, com base na conjugação de conhecimentos técnicos e tecnológicos com as suas práticas pedagógicas, conforme disposto na referida norma.\r\n\r\nA Lei nº 11.892/ 2008 ainda dispõe sobre as finalidades, características, objetivos, estrutura geral dos institutos federais.\r\n\r\nAtualmente, o IFAC apresenta 6 campi, localizados em 5 municípios do Estado do Acre. São eles:\r\n- Campus Cruzeiro do Sul\r\n- Campus Rio Branco\r\n- Campus Rio Branco Avançado Baixada do Sol\r\n- Campus Sena Madureira\r\n- Campus Tarauacá\r\n- Campus Xapuri",
