    "urlImagem": "https://dados.gov.br/api/publico/s3/befb68e5-5db9-4fd5-96b1-f0870fe954d2.jpg",
    "titulo": "universidade-federal-goias",
    "descricao": "A Universidade Federal de Goiás (UFG), código no MEC de número 584, pessoa jurídica de direito público na modalidade de autarquia, criada pela Lei nº 3.834C, de 14 de dezembro de 1960, é uma instituição pública federal de educação superior, com sede em Goiânia, capital do Estado de Goiás, e Câmpus implantados em Goiânia, Cidade de Goiás e Caldas Novas, Firminópolis e Aparecida de Goiânia.\r\n\r\nMissão: A UFG tem como missão produzir, sistematizar e socializar conhecimentos e saberes, formando profissionais e cidadãos comprometidos com o desenvolvimento da sociedade. \r\n\r\nFinalidade: A UFG é uma instituição comprometida com a justiça social, os valores democráticos e o desenvolvimento sustentável e, consoante a sua Missão, tem por finalidade produzir, sistematizar e transmitir conhecimentos, ampliando e aprofundando a formação humanística, profissional, crítica e reflexiva, conforme estabelece o Art. 6º de seu Estatuto.",
