  {
    "id": "0a457a01-2693-436e-9a45-048fa570eddb",
    "urlImagem": "https://dados.gov.br/api/publico/s3/854506c3-5cb6-4105-9849-bd5dd77fecb2.png",
    "titulo": "Fundação Universidade Federal do ABC - UFABC",
    "descricao": "No ano de 2004 o Ministério da Educação encaminhou ao Congresso Nacional o Projeto de Lei 3962/2004 que previa a criação da Universidade Federal do ABC. Essa Lei foi sancionada pelo Presidente da República e publicada no Diário Oficial da União de 27 de julho de 2005, com o Nº 11.145 e datada de 26 de julho de 2005. O Projeto Acadêmico da UFABC procura levar em conta as mudanças no campo da ciência, propondo uma matriz interdisciplinar, caracterizada pela intercessão de várias áreas do conhecimento científico e tecnológico. O Projeto da Universidade ressalta a importância de uma formação integral, que inclui a visão histórica da nossa civilização e privilegia a capacidade de inserção social no sentido amplo. Além disso, o projeto tem como meta a criação de um ambiente acadêmico favorável ao desenvolvimento social, contribuindo para a busca de soluções para os problemas regionais e nacionais, a partir da cooperação com outras instituições de ensino e pesquisa e instâncias do setor industrial e do poder executivo, legislativo e judiciário.\r\n\r\nPanorama Local\r\n\r\nAté a chegada da UFABC em 2005/2006, as sete cidades de região (Santo André, São Bernardo do Campo, São Caetano, Diadema, Mauá, Ribeirão Pires e Rio Grande da Serra) apresentavam uma enorme demanda de vagas no ensino público superior. O ABC possuía mais de 2,5 milhões de habitantes e uma oferta de 45 mil vagas distribuídas em 30 Instituições de Ensino Superior, sendo a grande maioria privada. Dos cerca de 77 mil estudantes matriculados no ensino superior na Região, cerca de 65% estavam em instituições privadas, 20% em municipais e 15% na rede comunitária filantrópica. Com a exceção de uma porcentagem ínfima de instituições que desenvolviam atividades de pesquisa, todas as demais se dedicavam apenas ao ensino. No setor de tecnologia e engenharia poucas apresentavam investimentos em pesquisa aplicada.",
