    "urlImagem": "https://dados.gov.br/api/publico/s3/4ccd3541-f01d-4e74-a6d0-394c6b92fd84.jpg",
    "titulo": "ebserh-filial-hospital-universitario-de-santa-maria",
    "descricao": "O Hospital Universitário de Santa Maria (HUSM) caracteriza-se como um hospital geral, de ensino, público, de nível terciário, que atende de forma integral pelo Sistema Único de Saúde (SUS). Tem por finalidade a formação profissional, desenvolvendo o Ensino, a Pesquisa e a Extensão, por meio da assistência à comunidade na área da saúde.\r\nLocalizado no campus da Universidade Federal de Santa Maria, no centro geográfico do estado do Rio Grande do Sul (RS), o HUSM presta serviços assistenciais e serve de campo de prática para alunos de ensino técnico, de graduação e de pós-graduação, dos cursos da área da saúde e outras áreas do conhecimento da Universidade Federal de Santa Maria (UFSM) e outras Instituições de Ensino da região.\r\nModelo de Gestão\r\nO Hospital vem passando por mudanças, especialmente, após a UFSM ter firmado o Contrato de Gestão Especial Gratuita (Contrato nº 263/2013), com a Empresa Brasileira de Serviços Hospitalares (Ebserh), em 17 de dezembro de 2013. Paulatinamente, a estrutura de governança (Superintendente, Gerentes, Chefes de Divisão, Chefes de Setores e Chefes de Unidades e Assessorias) passou a ser constituída, em consonância com o determinado pela Ebserh.\r\nA Ebserh adota como ferramenta de gestão o Plano Diretor Estratégico (PDE) - documento que expressa diretrizes e linhas estratégicas da instituição. Foi implementado no HUSM, como resultado do Curso “Gestão de Hospitais Universitários Federais no SUS” realizado por um grupo de nove Gestores, em 2014, por meio de um convênio estabelecido entre o Instituto Sírio-Libanês de Ensino e Pesquisa (IEP/HSL) e a Ebserh.  O PDE tem o objetivo de nortear o desenvolvimento do hospital na gestão, assistência, ensino e pesquisa, em consonância com as demandas prioritárias de assistência e formação para o Sistema Único de Saúde.\r\nEstá firmado um contrato, entre a Secretaria Estadual de Saúde e o HUSM, para a execução de serviços técnico-profissionais especializados, no qual consta metas quantitativas e qualitativas (mensais). Para que receba recursos pelo cumprimento dos serviços à população, necessita cumprir os atendimentos da média e alta complexidade. O Hospital recebe também repasses não regulares dos Ministérios da Educação e da Saúde para seu custeio, dentro do Programa Nacional de Reestruturação dos Hospitais Universitários Federais (REHUF).\r\nPerfil assistencial\r\nNa assistência ao paciente do Sistema Único de Saúde, o HUSM-UFSM constitui-se como o único hospital público da região centro-oeste do Estado do Rio Grande do Sul. É referência para atendimentos terciários de alta complexidade, pacientes portadores de complicações clínicas ou cirúrgicas, gestantes de alto risco, recém-nascidos e pacientes que necessitam transplantes de rim e de medula óssea.\r\nO HUSM compõe a Rede de Urgências e Emergências da Região Centro-Oeste, com suas referências pactuadas. No Setor de Internação, oferece atendimento em mais de 44 especialidades médicas nos 380 leitos disponíveis.\r\nNo que diz respeito às políticas do Ministério da Saúde, está inserido na Política Nacional de Humanização (PNH), nas Redes Cegonha e de Urgência e Emergência.\r\nO Hospital também está habilitado como Unidade de Alta Complexidade em Oncologia (Unacon), nos Serviços de Radioterapia, Hematologia e Oncologia Pediátrica. Contar com o Centro de Transplante de Medula Óssea (CTMO), que atende pacientes de todo o Rio Grande do Sul. O primeiro transplante de Medula Óssea da instituição foi realizado em 1997. Até 2019, já tinha realizado 314 (trezentos e quatorze) transplantes.\r\nO Serviço de Nefrologia - em funcionamento desde 1988 - possui habilitação como Unidade de Alta Complexidade. Realiza todos os métodos dialíticos, com foco em transplantes renais, totalizando 335 (trezentos e trinta e cinco) transplantes até o mês de junho de 2019.\r\nAlém dos Transplantes, oferece tratamentos de Câncer em geral, sendo referência para a macrorregião Centro-Oeste no Serviço de Oncologia Pediátrica.\r\nO Serviço de Cardiologia está habilitado como Unidade de Assistência de Alta Complexidade Cardiovascular, Cirurgia Cardiovascular e Procedimentos em Cardiologia Intervencionista, Cirurgia Vascular e Procedimentos Endo vasculares Extra cardíacos.\r\nO Serviço de Traumatologia possui habilitação como Unidade de Assistência de Alta Complexidade em Traumato-Ortopedia, com foco no atendimento de politraumatizados na emergência e Traumato-Ortopedia.\r\nO Hospital, ainda, é habilitado como Centro de Referência de Alta Complexidade em Terapia Nutricional Enteral e Parenteral para a região centro-oeste do Estado.\r\nO HUSM possui uma vasta produção técnico-assistencial em diferentes áreas. No ano de 2019, o Hospital contabilizou 16.499 internações; 7.881 procedimentos cirúrgicos realizados no Bloco Cirúrgico; 238.100 consultas ambulatoriais especializadas, sendo 92.199 consultas de outras especialidades não-médicas; 25.508 consultas de emergência; 2.146 partos; 29 transplantes (rins e medula óssea); 852.371 exames laboratoriais e de hemato. No referido ano, os indicadores de produtividade mostraram uma média de permanência hospitalar de 6,45 dias e uma taxa de ocupação hospitalar de 89,0%.\r\n\r\nModelo assistencial\r\nO modelo assistencial do HUSM é centrado no cuidado integral aos usuários, realizado de forma multiprofissional e interdisciplinar, respeitando os princípios de humanização, qualidade e segurança. Com o foco no paciente e familiares. Possui o desafio de implantar a Gestão da Clínica, conforme previsto no planejamento estratégico 2020-2024, busca estruturar o Projetos Terapêuticos Singular, que atendam às necessidades individuais de cada cliente.\r\nComo parte da estratégia da organização da assistência, vem implantando as Linhas de Cuidado, desenhadas de forma a assegurar o acesso, a qualidade da assistência e a segurança do paciente sendo elas: Linha do Cuidado Materno Infantil e Linha do Cuidado da hemato oncologia. E seguirá na implantação, conforme diretrizes do Ministério da Saúde.\r\nPrograma de Qualidade\r\nNa busca pela qualidade na prestaçã');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (633,
N'Detalha uma organização - GET',
N'',
N'{
  "id": "8a92c97c-0b00-42dd-a09a-0cd79cc832a4",
  "name": null,
  "displayName": "Centro Federal de Educação Tecnológica de Minas Gerais - CEFET-MG",
  "urlFoto": "https://dados.gov.br/api/publico/s3/715da1a7-7bbe-41f7-8425-2ae75e5a552d.jpg",
  "quantidadeSeguidores": 2,
  "quantidadeConjuntoDados": 15,
  "descricao": "O CEFET-MG é uma instituição de ensino centenária, com sua origem no Decreto nº 7.566, assinado pelo Presidente Nilo Peçanha, em 23 de Setembro de 1909 e, em 1978 passou a oferecer o Ensino Superior. Durante sua trajetória, o CEFET-MG recebeu diversas denominações:\r\n\r\n1909 – Escola de Aprendizes Artífices de Minas Gerais\r\n1941 – Liceu Industrial de Minas Gerais\r\n1942 – Escola Técnica de Belo Horizonte\r\n1969 – Escola Técnica Federal de Minas Gerais\r\n1978 – Centro Federal de Educação Tecnológica de Minas Gerais\r\n\r\nEstrutura Multicâmpus\r\n\r\nO CEFET-MG é a maior instituição de ensino tecnológico do Estado de Minas Gerais, levando às cidades seu ensino qualificado, suprindo a necessidade de mão obra capacitada. Suas unidades estão em áreas com intenso desenvolvimento industrial.\r\n1909 – Belo Horizonte\r\n1987 – Leopoldina\r\n1992 – Araxá\r\n1994 – Divinópolis\r\n2006 – Timóteo \r\n2006 – Varginha\r\n2007 – Nepomuceno \r\n2010 – Curvelo\r\n2012 – Contagem",
  "nome": "Centro Federal de Educação Tecnológica de Minas Gerais - CEFET-MG",
  "ativo": "active",
  "atributos": {
    "siorg": "445"
  }
}');

