              "DataTramitacao": "2013-12-17",
              "TextoTramitacao": "Na presente data foi realizada a 17ª Reunião da Comissão, no decorrer da discussão foram apresentadas emendas nos 807, 808 e 809 pelo Senador Vital do Rêgo. Foram destacadas as emendas nos 552, 553, 585 e 69. Em seguida foi aprovado o parecer do relator, Senador Pedro Taques, favorável ao Projeto de Lei do Senado nº 236, de 2012, nos termos da Emenda nº 1 - CTRCP (Substitutivo) e considerando a preferência sobre as demais proposições anexadas; pelo arquivamento de todas as proposições anexadas, com exceção do PLS nº 149, de 2008, e do PLS nº 135, de 2013; que devem ser desapendados e tramitar autonomamente, por não tratarem de matéria penal; pelo acolhimento das emendas nos 13, 15, 22, 33, 37, 51, 53, 55, 56, 69, 74, 77, 82, 83, 87, 91, 97, 99, 104, 107, 110, 128, 136, 150, 167, 171, 172, 173, 174, 176, 177, 182, 183, 188, 189, 194, 195, 198, 199, 200, 201, 202, 203, 204, 206, 210, 211, 212, 216, 217, 220, 221, 223, 225, 227, 229, 240, 244, 247, 250, 258, 292, 295, 315, 318, 325, 330, 338, 339, 354, 382, 423, 426, 496, 623, 646, 696, 712, 722, 725, 755, 756, 757, 758, 760, 761, 762, 763, 764, 793, 807, 808 e 809; após destacadas, pelo acolhimento das Emendas n.os 552, 553 e 585 e pela rejeição das demais.\n\nJuntados:\n- Lista de Presença (fls. 3104 – Vol. IX);\n- Emendas (fls.3105/3107 – Vol. IX);\n- Destaques (fls. 3107a/3117 – Vol. IX);\n- Parecer Aprovado (fls. 3118/3586 – Vol. IX);\n- Ata da 16ª reunião (fls. 3587/3602– Vol. IX);\n\nÀ SSCLSF.",
