                                            "descricao": "Nos termos do art. 58, §2º, incisos II e V da Constituição Federal, combinado com o art. 90, incisos II e V, do Regimento Interno do Senado Federal, requeiro sejam realizados, por esta Comissão de Serviços de Infraestrutura, ciclos de audiências públicas dentro de uma Agenda específica de debates ao longo do biênio 2013/2014, com renomados especialistas que apresentem depoimentos, análises e informações acerca de propostas setoriais para a infraestrutura, especialmente no que tange à modernização e expansão dos serviços, ao aumento da competitividade, à avaliação da capacidade de crescimento da economia e do bem-estar da população, e ao investimento e gestão como chaves para desatar o nó logístico do país.\nAs referidas audiências deverão ser realizadas com periodicidade quinzenal, às Segundas-Feiras, às 18h, na sala desta Comissão."
