  "items": [
    {
      "id": 3328,
      "titulo": "Pesquisa Nacional por Amostra de Domicílios Contínua Trimestral",
      "descricao": "",
      "data_divulgacao": "14/02/2025 12:00:00",
      "tipo_id": 1,
      "tipo": "Divulgação de Indicadores",
      "produto_id": 9173,
      "nome_produto": "Divulgação trimestral#pnadc2",
      "alias_produto": "pesquisa-nacional-por-amostra-de-domicilios-continua-trimestral",
      "descricao_produto": "<p align=\"justify\">Destina-se a produzir informações contínuas sobre a inserção da população no mercado de trabalho associada a características demográficas e de educação, e, também, para o estudo do desenvolvimento socioeconômico do País, agregando a produção de resultados anuais sobre temas permanentes da pesquisa (como trabalho infantil e outras formas de trabalho, migração, fecundidade etc.) e outros aspectos relevantes selecionados de acordo com as necessidades de informação.</p>\r\n<p align=\"justify\">A pesquisa é realizada por meio de uma amostra de domicílios, extraída de uma amostra mestra, de forma a garantir a representatividade dos resultados para os diversos níveis geográficos definidos para sua divulgação. A cada trimestre, são investigados 211.344 domicílios particulares permanentes, em aproximadamente 16.000 setores censitários, distribuídos em cerca de 3.500 municípios.</p>\r\n<p align=\"justify\"><strong>Periodicidade:</strong> Mensal, para um conjunto restrito de indicadores relacionados à força de trabalho e somente para o nível geográfico de Brasil; trimestral, para indicadores relacionados à força de trabalho; anual, para os demais temas permanentes da pesquisa e indicadores complementares relacionados à força de trabalho; e variável, para outros temas ou tópicos dos temas permanentes a serem pesquisados com maior periodicidade ou ocasionalmente.</p>\r\n<p align=\"justify\"><strong>Abrangência geográfica:</strong> Brasil, Grandes Regiões, Unidades da Federação, 20 Regiões Metropolitanas que contêm Municípios das Capitais (Manaus, Belém, Macapá, São Luís, Fortaleza, Natal, João Pessoa, Recife, Maceió, Aracaju, Salvador, Belo Horizonte, Vitória, Rio de Janeiro, São Paulo, Curitiba, Florianópolis, Porto Alegre, Vale do Rio Cuiabá, e Goiânia), Municípios das Capitais e Região Integrada de Desenvolvimento da Grande Teresina.</p>\r\n<p><strong>Análise dos dados da PNAD Contínua utilizando o software R</strong></p>\r\n<ul>\r\n<li><a id=\"asdfree\" class=\"link_desligado\" href=\"http://www.asdfree.com/search/label/pesquisa%20nacional%20por%20amostra%20de%20domicilios%20continua%20%28pnadc%29\" target=\"_blank\" rel=\"noopener noreferrer\">http://www.asdfree.com/search/label/pesquisa%20nacional%20por%20amostra%20de%20domicilios%20continua%20%28pnadc%29</a></li>\r\n</ul>",
      "ano_referencia_inicio": 2024,
      "mes_referencia_inicio": 10,
      "ano_referencia_fim": 2024,
      "mes_referencia_fim": 12,
      "link": ""
    }
  ]
}');

