antes de mão-de-obra para o setor  pecuário","Esta classe NÃO compreende - o serviço de engorda de animais em currais (grupo 01.5)\r\n- a produção da lã de tosquia (01.53-9)\r\n- as atividades de agentes comerciais de animais vivos (46.11-7)\r\n- a gestão de parques de leilão de gado (82.30-0)\r\n- os serviços de laboratórios de análises veterinárias (75.00-1)\r\n- a organização de exposições e feiras agropecuárias (82.30-0)\r\n- o treinamento de cães de estimação (96.09-2)\r\n- o alojamento, higiene e embelezamento de animais de estimação (96.09-2)\r\n- o aluguel de terras para pasto (68.10-2)"]},{"id":"01636","descricao":"ATIVIDADES DE PÓS-COLHEITA","grupo":{"id":"016","descricao":"ATIVIDADES DE APOIO À AGRICULTURA E À PECUÁRIA; ATIVIDADES DE PÓS-COLHEITA","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - a preparação primária de produtos agrícolas para o mercado realizada sob contrato:\r\n#- os serviços de limpeza, lavagem, classificação, desinfecção e ornamentação de produtos agrícolas\r\n#- o descaroçamento do algodão realizado no estabelecimento agrícola sob contrato\r\n#- o beneficiamento de arroz realizado no estabelecimento agrícola sob contrato\r\n#- o serviço de secagem de cereais realizado no estabelecimento agrícola sob contrato\r\n#- os serviços de sapeco, de secagem e de trituração, cancheamento, das folhas de erva-mate, realizado no ##estabelecimento agrícola sob contrato","Esta classe NÃO compreende - o processamento industrial do fumo, destalamento e outros beneficiamentos em unidades industriais (12.10-7)\r\n- a preparação de produtos agrícolas pelo produtor (grupo 01.1), (grupo 01.2) e (grupo 01.3)\r\n- as atividades de compra e venda de produtos agrícolas in natura (grupo 46.2)\r\n- os serviços de preparação de terreno, cultivo e colheita (01.61-0)\r\n- as atividades de intermediação na venda de produtos agrícolas in natura (46.11-7)"]},{"id":"01709","descricao":"CAÇA E SERVIÇOS RELACIONADOS","grupo":{"id":"017","descricao":"CAÇA E SERVIÇOS RELACIONADOS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - a caça convencional, a captura de animais com armadilha e o comércio básico\r\n- a captura de animais, mortos ou vivos, para alimentação, para obtenção de couros e peles, para pesquisa, para utilização em zoológicos ou como animais de estimação\r\n- a produção de peles com pêlos, peles de répteis ou pássaros através das atividades da caça convencional ou por captura com armadilha","Esta classe NÃO compreende - a criação de animais em estabelecimentos agropecuários (grupo 01.5)\r\n- a produção de couros e peles provenientes de matadouros e abatedouros (10.11-2) e (10.12-1)\r\n- a caça esportiva (93.19-1)"]}]');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (772,
