N'[{"id":"01113","descricao":"CULTIVO DE CEREAIS","grupo":{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - o cultivo de alpiste, arroz, aveia, centeio, cevada, milho, milheto, painço, sorgo, trigo, trigo preto, triticale e outros cereais não especificados anteriormente","Esta classe compreende ainda - o beneficiamento de cereais em estabelecimento agrícola, quando atividade complementar ao cultivo\r\n- a produção de sementes de cereais, quando atividade complementar ao cultivo","Esta classe NÃO compreende - a produção de sementes certificadas dos cereais desta classe, inclusive modificadas geneticamente (01.41-5)\r\n- os serviços de preparação de terreno, cultivo e colheita realizados sob contrato (01.61-0)\r\n- o beneficiamento de cereais em estabelecimento agrícola realizado sob contrato (01.63-6)\r\n- o processamento ou beneficiamento de cereais em estabelecimento não-agrícola (grupo 10.4) e (grupo 10.6)\r\n- a produção de biocombustível (19.32-2)"]},{"id":"01121","descricao":"CULTIVO DE ALGODÃO HERBÁCEO E DE OUTRAS FIBRAS DE LAVOURA TEMPORÁRIA","grupo":{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - o cultivo de algodão herbáceo\r\n- o cultivo de juta, junco, linho, malva, rami, sorgo vassoura e outras fibras de lavoura temporária não especificadas anteriormente","Esta classe compreende ainda - o descaroçamento do algodão, quando atividade complementar ao cultivo\r\n- o processo de maceração e secagem das fibras desta classe\r\n- a produção de sementes e mudas das fibras desta classe, quando atividade compleme