sse NÃO compreende - a produção de sementes certificadas de fumo, inclusive modificadas geneticamente (01.41-5)\r\n- os serviços de preparação de terreno, cultivo e colheita realizados sob contrato (01.61-0)\r\n- o processamento do fumo através de secagem, defumação e outros processos realizado em unidade industrial (12.10-7)"]},{"id":"01156","descricao":"CULTIVO DE SOJA","grupo":{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - o cultivo de soja","Esta classe compreende ainda - a produção de semente de soja, quando atividade complementar ao cultivo","Esta classe NÃO compreende - a produção de sementes certificadas de soja, inclusive modificadas geneticamente (01.41-5)\r\n- os serviços de preparação de terreno, cultivo e colheita realizados sob contrato\r\n(01.61-0)\r\n- a produção de óleo de soja em bruto, inclusive torta e farelo (10.41-4)\r\n- a produção de biocombustível (19.32-2)"]},{"id":"01164","descricao":"CULTIVO DE OLEAGINOSAS DE LAVOURA TEMPORÁRIA, EXCETO SOJA","grupo":{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - o cultivo de amendoim, colza, gergelim, girassol, linho, mamona e outras oleaginosas de lavoura temporária não especificadas anteriormente","Esta classe compreende ainda - a produção de sementes das oleaginosas desta classe, quando atividade complementar ao cultivo","Esta classe NÃO compreende - o cultivo de soja (01.15-6)\r\n- a produção de sementes certificadas das oleaginosas desta classe, inclusive modificadas geneticamente (01.41-5)\r\n- os serviços de preparação de terreno, cultivo e colheita realizados sob contrato (01.61-0)\r\n- a produção de óleos vegetais em bruto (10.41-4)\r\n- a produção de biocombustível (19.32-2)"]},{"id":"01199","descricao":"CULTIVO DE PLANTAS DE LAVOURA TEMPORÁRIA NÃO ESPECIFICADAS ANTERIORMENTE","grupo":{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}}},"observacoes":["Esta classe compreende - o cultivo de abóbora, feijão verde, palma rosa, tomate rasteiro e vetiver\r\n- o cultivo de capim napier, milho forrageiro, palma forrageira, trevo forrageiro\r\n- o cultivo de abacaxi, melancia, melão\r\n- o cultivo de ervilha em grão seco, fava, feijão\r\n- o cultivo de alho, cebola\r\n- o cultivo de batata-inglesa, mandioca\r\n- o cultivo de outras plantas de lavoura temporária não especificadas anteriormente","Esta classe compreende ainda - a produção de sementes e mudas das plantas desta classe, quando atividade complementar ao cultivo","Esta classe NÃO compreende - o cultivo de morango (01.21-1)\r\n- o cultivo de tomate estaqueado (01.21-1)\r\n- o cultivo de araruta, batata-doce, cará e inhame (01.21-1)\r\n- o cultivo de legumes e hortaliças (01.21-1)\r\n- a produção de sementes e mudas certificadas das plantas desta classe, inclusive modificadas geneticamente (grupo 01.4)\r\n- os serviços de preparação de terreno, cultivo e colheita realizados sob contrato\r\n(01.61-0)\r\n- o beneficiamento ou a transformação dos produtos agrícolas desta classe (10.31-7) e (10.32-5)\r\n- a produção de suco de frutas e de legumes desta classe (10.33-3)"]}]');

