INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (774,
N'Divisões',
N'',
N'[
  {
    "id": "01",
    "descricao": "AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS",
    "secao": {
      "id": "A",
      "descricao": "AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"
    },
    "observacoes": [
      "Esta divisão compreende o cultivo de lavouras e a criação e produção animal.\r\n\r\nNo cultivo de lavouras são identificados quatro segmentos (grupos): produção de lavouras temporárias (grupo 01.1); horticultura e floricultura (grupo 01.2); produção de lavouras permanentes (grupo 01.3); produção de sementes e mudas certificadas (grupo 01.4), onde estão incluídos os processos de cultivo tradicional, orgânico, bem como o cultivo de plantas modificadas geneticamente.\r\n\r\nNa criação e produção animal identifica-se um único grupo: pecuária (grupo 01.5), onde também se inclui a criação de animais modificados geneticamente.\r\n\r\nA produção de sementes e mudas das lavouras, quando associada ao cultivo, classifica-se na mesma classe CNAE do cultivo. As unidades especializadas na produção de sementes e mudas certificadas, inclusive modificadas geneticamente, são classificadas em categoria própria (grupo 01.4).\r\n\r\nO processamento, na unidade de produção agrícola, de produtos agrícolas ou pecuários provenientes de produção própria classifica-se no mesmo código da atividade da produção. Quando o processamento é desempenhado por terceiros, classifica-se na seção C - indústrias de transformação.\r\n\r\nEsta divisão compreende também a caça tradicional e com armadilha, as atividades de apoio à agricultura e à pecuária e às atividades de pós-colheita.\r\n\r\nAs atividades de apoio à agricultura - preparo do solo, plantio, colheita, etc. - e de apoio à pecuária - manejo dos animais, inseminação artificial, etc. - executadas sob contrato estão incluídas nesta divisão em categorias específicas de serviços de apoio à agricultura (01.61-0) e à pecuária (01.62-8). Estes serviços, quando executados em unidades de produção agrícola ou de pecuária com recursos próprios, ficam incluídos na mesma classe onde se classifica a unidade de produção.\r\n\r\nPor atividades pós-colheita (01.63-6) entende-se a preparação primária de produtos agrícolas para o mercado (limpeza, ornamentação, classificação, desinfecção)."
    ]
  },
  {
    "id": "02",
    "descricao": "PRODUÇÃO FLORESTAL",
    "secao": {
      "id": "A",
      "descricao": "AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"
    },
    "observacoes": [
      "Esta divisão compreende o cultivo de espécies florestais, a produção de madeira em toras e a exploração de produtos florestais não-madeireiros.\r\n\r\nCompreende também a produção de mudas florestais, os produtos da madeira resultantes de pequeno processamento - lenha, carvão vegetal, lascas de madeira - assim como a madeira utilizada sem processamento - moirões, estacas e postes. \r\n\r\nEstas atividades podem ocorrer em florestas plantadas ou nativas."
    ]
  }
]');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (775,
N'Divisões por seção',
N'',
N'[{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"},"observacoes":["Esta divisão compreende o cultivo de lavouras e a criação e produção animal.\r\n\r\nNo cultivo de lavouras são identificados quatro segmentos (grupos): produção de lavouras temporárias (grupo 01.1); horticultura e floricultura (grupo 01.2); produção de lavouras permanentes (grupo 01.3); produção de sementes e mudas certificadas (grupo 01.4), onde estão incluídos os processos de cultivo tradicional, orgânico, bem como o cultivo de plantas modificadas geneticamente.\r\n\r\nNa criação e produção animal identifica-se um único grupo: pecuária (grupo 01.5), onde também se inclui a criação de animais modificados geneticamente.\r\n\r\nA produção de sementes e mudas das lavouras, quando associada ao cultivo, classifica-se na mesma classe CNAE do cultivo. As unidades especializadas na produção de sementes e mudas certificadas, inclusive modificadas geneticamente, são classificadas em categoria própria (grupo 01.4).\r\n\r\nO processamento, na unidade de produção agrícola, de produtos agrícolas ou pecuários provenientes de produção própria classifica-se no mesmo código da atividade da produção. Quando o processamento é desempenhado por terceiros, classifica-se na seção C - indústrias de transformação.\r\n\r\nEsta divisão compreende também a caça tradicional e com armadilha, as atividades de apoio à agricultura e à pecuária e às atividades de pós-colheita.\r\n\r\nAs atividades de apoio à agricultura - preparo do solo, plantio, colheita, etc. - e de apoio à pecuária - manejo dos animais, inseminação artificial, etc. - executadas sob contrato estão incluídas nesta divisão em categorias específicas de serviços de apoio à agricultura (01.61-0) e à pecuária (01.62-8). Estes serviços, quando executados em unidades de produção agrícola ou de pecuária com recursos próprios, ficam incluídos na mesma classe onde se classifica a unidade de produção.\r\n\r\nPor atividades pós-colheita (01.63-6) entende-se a preparação primária de produtos agrícolas para o mercado (limpeza, ornamentação, classificação, desinfecção)."]},{"id":"02","descricao":"PRODUÇÃO FLORESTAL","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"},"observacoes":["Esta divisão compreende o cultivo de espécies florestais, a produção de madeira em toras e a exploração de produtos florestais não-madeireiros.\r\n\r\nCompreende também a produção de mudas florestais, os produtos da madeira resultantes de pequeno processamento - lenha, carvão vegetal, lascas de madeira - assim como a madeira utilizada sem processamento - moirões, estacas e postes. \r\n\r\nEstas atividades podem ocorrer em florestas plantadas ou nativas."]},{"id":"03","descricao":"PESCA E AQÜICULTURA","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"},"observacoes":["Esta divisão compreende a pesca e a criação de animais aquáticos, abrangendo o uso dos recursos pesqueiros em águas marinhas, salobras e em água doce, objetivando a captura de peixes, crustáceos, moluscos e de outros organismos ou produtos aquáticos (plantas aquáticas, pérolas, esponjas, outros).\r\n\r\nTambém compreende as atividades normalmente integradas ao processo de produção na aqüicultura (produção de sementes de ostras para produção de pérolas).\r\n\r\nEsta divisão não compreende a construção e reparação de navios e barcos (divisão 30), a atividade de pesca esportiva ou recreativa (divisão 85) e o processamento de peixes, crustáceos e moluscos realizado em estabelecimento industrial ou em barco-fábrica (divisão 10)."]}]');

INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (776,
N'Grupos por divisão',
N'',
N'[{"id":"011","descricao":"PRODUÇÃO DE LAVOURAS TEMPORÁRIAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":["Este grupo compreende o cultivo de plantas de ciclo vegetativo de curta duração, até 1 (um) ano, utilizando técnicas de cultivo tradicional, orgânico, ou ainda o cultivo de plantas modificadas geneticamente."]},{"id":"012","descricao":"HORTICULTURA E FLORICULTURA","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":["Este grupo compreende o cultivo de produtos hortícolas e de plantas da floricultura - flores, folhagens e plantas ornamentais - para corte, vasos, jardino-cultura, ornamentação ou paisagismo. Os produtos hortícolas são plantas de consistência herbácea com ciclo vegetativo de até 6 (seis) meses, normalmente cultivadas de forma intensiva. As plantas da floricultura têm ciclos vegetativos de curta, média ou de longa duração.\r\n\r\nAs plantas deste grupo são cultivadas em ambiente natural ou protegido (estufas, casas de vegetação, hidroponia, plasticultura), utilizando técnicas de cultivo tradicional, orgânico, ou ainda o cultivo de plantas modificadas geneticamente."]},{"id":"013","descricao":"PRODUÇÃO DE LAVOURAS PERMANENTES","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":["Este grupo compreende o cultivo de plantas perenes, isto é, de ciclo vegetativo de longa duração. Essas plantas produzem por vários anos sucessivos sem a necessidade de novos plantios após colheita, sendo utilizadas técnicas de cultivo tradicional, orgânico, assim como o cultivo de plantas modificadas geneticamente."]},{"id":"014","descricao":"PRODUÇÃO DE SEMENTES E MUDAS CERTIFICADAS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":["Este grupo compreende a produção de sementes e mudas certificadas.\r\n\r\nA produção de sementes e mudas certificadas é realizada por produtores agrícolas especializados a partir de sementes básicas que resultam da multiplicação de sementes genéticas, desenvolvidas em laboratório. A permanência das características obtidas com o melhoramento genético é garantida pela entidade certificadora da semente genética, através de testes em laboratórios de análise de sementes e de plantio em campo.\r\n\r\nO melhoramento genético pode ser obtido de forma tradicional, a partir de cruzamento de plantas, ou com o uso de engenharia genética, envolvendo interferência direta no DNA da planta."]},{"id":"015","descricao":"PECUÁRIA","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":["Este grupo compreende a criação e a produção animal, exceto animais aquáticos.\r\n\r\nNeste grupo as classes de atividades são organizadas segundo a espécie animal.\r\n\r\nEste grupo compreende também a criação de animais modificados geneticamente.\r\n\r\nEste grupo não compreende o alojamento do gado por curta duração (grupo 01.6)."]},{"id":"016","descricao":"ATIVIDADES DE APOIO À AGRICULTURA E À PECUÁRIA; ATIVIDADES DE PÓS-COLHEITA","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":[""]},{"id":"017","descricao":"CAÇA E SERVIÇOS RELACIONADOS","divisao":{"id":"01","descricao":"AGRICULTURA, PECUÁRIA E SERVIÇOS RELACIONADOS","secao":{"id":"A","descricao":"AGRICULTURA, PECUÁRIA, PRODUÇÃO FLORESTAL, PESCA E AQÜICULTURA"}},"observacoes":[""]}]');

