INSERT INTO [Respostas da API] (Id, Description, DataDictionary, ResponseExample)
VALUES (866,
N'Metatados por pesquisa e período pesquisado
',
N'',
N'{"situacao_ingles":"Active","categoria_ingles":"Structural","tipo":"Pesquisa de empresas","tipo_ingles":"Survey of enterprises","area":"Estatísticos","sigla":"PAIC","data_inicio":"01/01/1990","data_desativacao":"","url_sidra":"https://sidra.ibge.gov.br/pesquisa/paic","url_concla":null,"periodicidade_coleta_ingles":"Annual","periodicidade_divulgacao_ingles":"Annual","ocorrencias_pesquisa":[{"sigla":"PAIC2003","data_inicio_coleta":"","data_fim_coleta":"","data_previsao_divulgacao":"","historico":"A s&eacute;rie da PAIC teve in&iacute;cio em 1990, tendo como cadastro de sele&ccedil;&atilde;o os Censos Econ&ocirc;micos 1985 e como &acirc;mbito as empresas do setor da constru&ccedil;&atilde;o que cobriam, no m&iacute;nimo, 80% do valor bruto da produ&ccedil;&atilde;o, no cruzamento de Unidades da Federa&ccedil;&atilde;o e subgrupos da classifica&ccedil;&atilde;o da constru&ccedil;&atilde;o adotada no Censo 1985. Em 1996, com o in&iacute;cio do Programa de Moderniza&ccedil;&atilde;o das Estat&iacute;sticas Econ&ocirc;micas, a pesquisa passou a investigar todas as empresas do setor com 40 ou mais pessoas ocupadas empregando a Classifica&ccedil;&atilde;o Nacional de Atividades Econ&ocirc;micas - CNAE. A partir de 2002, a pesquisa utiliza a amostragem probabil&iacute;stica, e seu desenho amostral passa a ser semelhante ao das demais pesquisas econ&ocirc;micas anuais. &Eacute; importante enfatizar que a PAIC abrange o universo das empresas de constru&ccedil;&atilde;o, inclusive as com menos de 5 pessoas ocupadas. <br>Em 2007, houve uma mudan&ccedil;a de CNAE, da vers&atilde;o 1.0 para 2.0. A partir do ano de refer&ecirc;ncia 2008, o IBGE passou, assim, a divulgar uma nova serie de dados da pesquisa, com base na CNAE 2.0, que substitui a estrutura usada anteriormente.","historico_ingles":null,"objetivo":"A pesquisa tem por objetivo produzir e disseminar um conjunto de informa&ccedil;&otilde;es econ&ocirc;mico-financeiras que permitam estimar as caracter&iacute;sticas estruturais da atividade de constru&ccedil;&atilde;o no Pa&iacute;s e acompanhar  suas transforma&ccedil;&otilde;es no tempo. As informa&ccedil;&otilde;es levantadas priorizam as estimativas do valor adicionado, valor das obras,  m&atilde;o de obra ocupada e sua remunera&ccedil;&atilde;o e  investimentos em capital fixo entre outros, al&eacute;m de possibilitar outros usos em an&aacute;lises da atividade de constru&ccedil;&atilde;o do Pa&iacute;s.","objetivo_ingles":null,"populacao_alvo":"Inclui as empresas que atendem aos seguintes requisitos:<br>- estar em situa&ccedil;&atilde;o ativa no Cadastro Central de Empresas - CEMPRE do IBGE, que cobre as entidades com registro no Cadastro Nacional da Pessoa Jur&iacute;dica - CNPJ;<br>- ter atividade principal compreendida na se&ccedil;&atilde;o F (Constru&ccedil;&atilde;o) da Classifica&ccedil;&atilde;o Nacional de Atividades Econ&ocirc;micas - CNAE, isto &eacute;, estar identificada no CEMPRE com c&oacute;digo das classes (4 d&iacute;gitos) desta se&ccedil;&atilde;o;<br>- estar sediada no Territ&oacute;rio Nacional; e<br>- ter pelo menos 1 pessoa ocupada em 31 de dezembro do ano de refer&ecirc;ncia do cadastro b&aacute;sico de sele&ccedil;&atilde;o da pesquisa.","populacao_alvo_ingles":null,"metodologia":"Em 2002, consolidou-se a mudan&ccedil;a metodol&oacute;gica da PAIC. A partir desse ano, a investiga&ccedil;&atilde;o &eacute; feita por amostragem probabil&iacute;stica, com o desenho amostral da pesquisa sendo semelhante ao das demais pesquisas anuais, no sentido de ter a empresa como unidade de sele&ccedil;&atilde;o, diferenciar os estratos de sele&ccedil;&atilde;o em fun&ccedil;&atilde;o da concentra&ccedil;&atilde;o da atividade produtiva nos segmentos de maior porte.<br>O plano amostral da PAIC emprega amostragem estratificada por corte com 5 estratos em cada estrato natural formado pela Unidade da Federa&ccedil;&atilde;o combinada com divis&otilde;es ou grupos de atividades da Classifica&ccedil;&atilde;o Nacional de Atividades Econ&ocirc;micas - CNAE denominados estratos finais. A delimita&ccedil;&atilde;o desses estratos obedeceu a um crit&eacute;rio gerencial, de acordo com o n&uacute;mero de pessoas ocupadas. Em raz&atilde;o disto, a defini&ccedil;&atilde;o dos limites dos estratos ficou da seguinte forma: de 1 a 4 pessoas, de 5 a 9 pessoas, de 10 a 19 pessoas,  de 20 a 29 pessoas, e com 30 e mais pessoas ocupadas. Ressalta-se que, para a combina&ccedil;&atilde;o dos estratos finais amostrados com menos de 5 pessoas ocupadas, utilizou-se a classifica&ccedil;&atilde;o de atividade segundo a Divis&atilde;o (2 d&iacute;gitos) e ,com pessoas ocupadas entre 5 e 29, a classifica&ccedil;&atilde;o em n&iacute;vel de Grupo (3 d&iacute;gitos). No caso da PAIC, alocou-se em estratos certos as empresas com pessoal ocupado igual ou superior a 30 e/ou que auferiram receita bruta da constru&ccedil;&atilde;o superior a R$ 9,94 milh&otilde;es no ano anterior ao de refer&ecirc;ncia da pesquisa.<br>Nos demais estratos, o tamanho da amostra foi calculado, em cada estrato natural, fixando em 6% o coeficiente de varia&ccedil;&atilde;o do estimador do total de pessoal ocupado e foram selecionadas usando amostragem aleat&oacute;ria simples sem reposi&ccedil;&atilde;o.<br> Arbitrou-se que todas as empresas de um estrato final amostrado s&atilde;o, automaticamente, inclu&iacute;das na amostra sempre que o n&uacute;mero de empresas daquele estrato final for menor que cinco. O tamanho final da amostra &eacute; obtido pela soma dos tamanhos da amostra de cada estrato final (certo e amostrado). No momento da sele&ccedil;&atilde;o da amostra da PAIC 2011, das 165 558 empresas de constru&ccedil;&atilde;o que compunham o cadastro b&aacute;sico de sele&ccedil;&atilde;o, e que atendiam aos crit&eacute;rios de defini&ccedil;&atilde;o da popula&ccedil;&atilde;o-alvo, foram selecionadas 22 461 empresas.","metodologia_ingles":null,"notas_ocorrencia":null,"notas_ocorrencia_ingles":null,"ind_divulgacao":"S","principais_variaveis":"As principais vari&aacute;veis investigadas s&atilde;o: pessoal ocupado, sal&aacute;rios, receita bruta, custos e despesas, resultado do exerc&iacute;cio, aquisi&ccedil;&atilde;o e baixa de ativos, materiais de constru&ccedil;&atilde;o consumidos, valor adicionado, valor das incorpora&ccedil;&otilde;es, das obras e/ou servi&ccedil;os da constru&ccedil;&atilde;o, tipos de obras e/ou servi&ccedil;os da constru&ccedil;&atilde;o por cliente contratante.","principais_variaveis_ingles":null,"niveis_divulgacao":"Brasil, Regi&otilde;es e Unidades da Federa&ccedil;&atilde;o segundo grupos e classes da CNAE.","niveis_divulgacao_ingles":null,"nivel_geografico_abrangencia":"","nivel_geografico_abrangencia_ingles":"","nivel_geografico_desagregacao":"","nivel_geografico_desagregacao_ingles":"","instituicoes_responsaveis":[{"nome":"Instituto Brasileiro de Geografia e Estatística - Diretoria de Pesquisas - Coordenação de Indústria - Responsável pela Coleta de Dados","nome_ingles":"Brazilian Institute of Geography and Statistics - Data Collection Representative"}],"periodos_referencia":[{"nome":"Data - 01/01/2003","nome_ingles":"Day - 01/01/2003"}],"tipos_dados":[{"nome":"Dados de pesquisa por amostragem probabilística","nome_ingles":"Data from probability sampling surveys"}],"unidades_informante":[],"unidades_investigacao":[],"unidades_analise":[],"tecnicas_coleta":[{"nome":"CASI - Questionário eletrônico autopreenchido","nome_ingles":"CASI - Computer-Assisted Self Interviewing"}],"formas_disseminacao":[],"nivel_desagregacao":"","nivel_desagregacao_ingles":"","instrumentos_coleta":[{"nome":"PAIC - Questionário","nome_ingles":null,"link":"http://biblioteca.ibge.gov.br/visualizacao/instrumentos_de_coleta/doc2340.pdf"}],"palavras_chave":null,"palavras_chave_ingles":null,"definicao_fatores_expansao":null,"definicao_fatores_expansao_ingles":null,"notas_coleta_dados":null,"notas_coleta_dados_ingles":null,"supervisao":null,"supervisao_ingles":null,"critica_imputacao":null,"critica_imputacao_ingles":null,"outras_info_processamento":null,"outras_info_processamento_ingles":null,"calculo_erro_amostral":null,"calculo_erro_amostral_ingles":null,"outras_info_qualidade":null,"outras_info_qualidade_ingles":null,"autoridade_acesso":null,"autoridade_acesso_ingles":null,"confidencialidade":null,"confidencialidade_ingles":null,"condicoes_acesso":null,"condicoes_acesso_ingles":null,"referencia_citacao_fonte":null,"referencia_citacao_fonte_ingles":null,"base_legal":null,"base_legal_ingles":null,"direitos_autorais":null,"direitos_autorais_ingles":null,"contato":null,"contato_ingles":null,"procedimento_amostragem":"","procedimento_amostragem_ingles":"","ocorrencias_variavel":[],"qualidade":null,"observacoes_sidra":null,"observacoes_sidra_ingles":null,"recomendacoes_internacionais_referencias_metodologicas":null,"recomendacoes_internacionais_referencias_metodologicas_ingles":null,"ano":2003,"mes":0,"ordem_periodo":0,"nome_ocorrencia":"Pesquisa Anual da Indústria da Construção - 2003","nome_ocorrencia_ingles":null}],"codigo":"AC","nome":"Pesquisa Anual da Indústria da Construção","nome_ingles":null,"situacao":"Ativa","categoria":"Estrutural","periodicidade_coleta":"Anual","periodicidade_divulgacao":"Anual","classificacoes_tematicas":[{"nome":"Estatísticas econômicas setoriais","nome_ingles":"Sectoral economic statistics","descricao":"Compreende as informações sobre atividades econômicas desenvolvidas pelas unidades de produção, abrangendo ramos específicos, tais como Agricultura, pecuária, produção florestal, pesca e aquicultura, Indústrias extrativas, Indústrias de transformação, Construção, Comércio e Serviços, definidos de acordo com a sua atividade principal, segundo a Classificação Nacional de Atividades Econômicas - CNAE 2.0.\r\n\r\nEste tema não compreende:\r\n\r\n- Educação\r\n- Saúde\r\n- Governo e estatísticas do setor público (<i>Finanças públicas</i>)\r\n- Estatísticas financeiras\r\n- Pesquisa e Desenvolvimento - P&D (<i>Ciência, Tecnologia e Inovação</i>)\r\n- Setor de Tecnologias de Informação e Comunicação - setor TIC (<i>Sociedade da informação</i>)","descricao_ingles":null,"dominio":"Estatísticas econômicas","dominio_ingles":"Economic statistics"},{"nome":"Construção","nome_ingles":"Construction","descricao":"Compreende as informações econômico-financeiras, de produção, bens e serviços consumidos, e emprego, entre outros aspectos, específicas das atividades da Construção, que pertencem à seção F da CNAE 2.0.\r\n\r\nEste tema não compreende:\r\n\r\nCustos e índices da construção civil (<i>Preços e custos</i>)","descricao_ingles":null,"dominio":"Estatísticas econômicas","dominio_ingles":"Economic statistics"}]}');

