        "nome": "Estatísticas econômicas setoriais",
        "nome_ingles": "Sectoral economic statistics",
        "descricao": "Compreende as informações sobre atividades econômicas desenvolvidas pelas unidades de produção, abrangendo ramos específicos, tais como Agricultura, pecuária, produção florestal, pesca e aquicultura, Indústrias extrativas, Indústrias de transformação, Construção, Comércio e Serviços, definidos de acordo com a sua atividade principal, segundo a Classificação Nacional de Atividades Econômicas - CNAE 2.0.\r\n\r\nEste tema não compreende:\r\n\r\n- Educação\r\n- Saúde\r\n- Governo e estatísticas do setor público (<i>Finanças públicas</i>)\r\n- Estatísticas financeiras\r\n- Pesquisa e Desenvolvimento - P&D (<i>Ciência, Tecnologia e Inovação</i>)\r\n- Setor de Tecnologias de Informação e Comunicação - setor TIC (<i>Sociedade da informação</i>)",
        "descricao_ingles": null,
        "dominio": "Estatísticas econômicas",
        "dominio_ingles": "Economic statistics"
      },
