        "descricao": "Compreende as informações econômico-financeiras, de produção, bens e serviços consumidos, e emprego, entre outros aspectos, específicas das atividades da Construção, que pertencem à seção F da CNAE 2.0.\r\n\r\nEste tema não compreende:\r\n\r\nCustos e índices da construção civil (<i>Preços e custos</i>)",
