        "descricao_ingles": "Includes information on general characteristics of the population, demographic components (fertility, migration, mortality); vital statistics, families, nuptiality, specific population groups, among others.\r\n\r\nThis theme does not include:\r\nCauses of death (1.04)\r\nGender (3.01.5)\r\nReligion (3.01.6)",
