-de-noticias/noticias/41797-censo-2022-brasil-tinha-16-4-milhoes-de-pessoas-morando-em-favelas-e-comunidades-urbanas.html"},{"id":41795,"tipo":"Release","titulo":"IPCA foi de 0,56% em outubro ","introducao":"O Índice Nacional de Preços ao Consumidor Amplo (IPCA) de outubro foi de 0,56% e ficou 0,12 ponto percentual acima da taxa de setembro (0,44%). No ano, o IPCA acumula alta de 3,88% e, nos últimos 12 meses, de 4,76%, acima dos 4,42% observados nos 12...","data_publicacao":"08/11/2024 09:00:00","produto_id":0,"produtos":"9256|Índice Nacional de Preços ao Consumidor Amplo|indice-nacional-de-precos-ao-consumidor-amplo|2210;9258|Índice Nacional de Preços ao Consumidor|indice-nacional-de-precos-ao-consumidor|2077","editorias":"economicas","imagens":"{\"image_intro\":\"images\\/agenciadenoticias\\/releases\\/IPCA_Release1.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/agenciadenoticias\\/releases\\/IPCA_Release1.png\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}","produtos_relacionados":"9256, 9258","destaque":true,"link":"http://agenciadenoticias.ibge.gov.br/agencia-sala-de-imprensa/2013-agencia-de-noticias/releases/41795-ipca-foi-de-0-56-em-outubro.html"},{"id":41790,"tipo":"Release","titulo":"Em outubro, Índice Nacional da Construção Civil varia 0,53%","introducao":"O Índice Nacional da Construção Civil (SINAPI) variou 0,53% em outubro, ficando 0,18 ponto percentual abaixo do índice de setembro  (0,35%). O acumulado nos últimos 12 meses foi de 3,86%, resultado acima dos 3,46% registrados nos 12 meses imediatamente...","data_publicacao":"08/11/2024 09:00:00","produto_id":9270,"produtos":"9270|Sistema Nacional de Pesquisa de Custos e Índices da Construção Civil|sistema-nacional-de-pesquisa-de-custos-e-indices-da-construcao-civil|2079","editorias":"economicas","imagens":"{\"image_intro\":\"images\\/agenciadenoticias\\/releases\\/SINAPI_Release.png\",\"float_intro\":\